import React, { Fragment } from 'react';
import Cardlist from './Cardlist'
import {robots} from './robots';
const App=()=>{
    return (
        <div>
            <h1>Robo Friends</h1>
            <Cardlist robots={robots}/> 
        </div>
    );
}
export default App;
